import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { withStyles } from "@material-ui/core/styles";
import Drawer from "@material-ui/core/Drawer";
import CssBaseline from "@material-ui/core/CssBaseline";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Paper from "@material-ui/core/Paper";
//import List from "@material-ui/core/List";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import MenuItem from "@material-ui/core/MenuItem";
import Menu from "@material-ui/core/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
//import ListItem from "@material-ui/core/ListItem";
//import ListItemIcon from "@material-ui/core/ListItemIcon";
//import ListItemText from "@material-ui/core/ListItemText";
import AttachMoney from "@material-ui/icons/AttachMoney";
import MailIcon from "@material-ui/icons/Mail";
import Badge from "@material-ui/core/Badge";
import AccountCircle from "@material-ui/icons/AccountCircle";
import MonetizationOn from "@material-ui/icons/MonetizationOn";

//import MoreIcon from "@material-ui/icons/MoreVert";
//import Clicktest from "./clicktest";
import Nested from "./nested";
import Nestedv2 from "./nestedv2";
import TableTest from "./tabletest";
import PageTitleBar from "./pageTitleBar";
import TeamMemberActions from "./teamMemberActions";
//import TeamMemberCheckedV2 from "./teamMemberCheckedv2";
import ActiveRadioButton from "./activeRadioButton";
import TeamMemberChecked from "./teamMemberChecked";
import MemberAvatar from "./memberAvatar";
import MemberTopPanel from "./memberTopPanel";
import TeamMemberDetailsTabs from "./teamMemberDetailsTabs";
import clientTextInputs from "./clientTextInputs";

import AssignedClientsTable from "./assignedClientsTable";
import AssignedClientsActions from "./asssignedClientsActions";
import AccountsInvoicesTabs from "./accountsInvoicesTabs";
import TemplatesActions from "./templatesActions";
import TemplatesTable from "./templatesTable";
import DocumentationTabs from "./documentationTabs";
import FormsTabs from "./formsTabs";
import TeamMembersTable from "./teamMembersTable";
import ClientActions from "./clientActions";
import ClientTable from "./clientTable";
import ClientTopPanel from "./clientTopPanel";
import ClientDetailsTabs from "./clientDetailsTabs";
import KPI1 from "./kpi1";
import DailyViewKPI from "./dailyViewKPI";
import KPI2 from "./kpi2";
import MemberPanelTabs from "./memberPanelTabs";
import ClientPanelTabs from "./clientPanelTabs";
import ReactCalendarBase from "./ReactCalendarBase";
//import DatePicker from "./datePicker";
import DatePicker from "./datePicker";
import TimePicker from "./timePicker";

//width of drawer
const drawerWidth = 245;

// declaring stylesGroupAddTwoTone
const styles = theme => ({
  root: {
    display: "flex"
  },

  roottest: {
    // paddingTop: theme.spacing.unit * 1,
    // paddingBottom: theme.spacing.unit * 1,
    paddingLeft: theme.spacing.unit,
    marginTop: theme.spacing.unit * -1,
    marginLeft: theme.spacing.unit * 30,
    //marginRight: theme.spacing.unit * 30,
    align: "center",
    width: "875",
    height: "120"
  },

  rightToolbar: {
    marginLeft: "auto",
    marginRight: -12
  },

  // no visible change
  appBar: {
    transition: theme.transitions.create(["margin", "width"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    })
  },
  // pushes appBar to the right
  appBarShift: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
    transition: theme.transitions.create(["margin", "width"], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen
    })
  },

  // Menu button positioning
  menuButton: {
    marginLeft: 12,
    marginRight: 20
  },

  // no visible change
  hide: {
    display: "none"
  },

  // displays drawer and does ___??__
  drawer: {
    width: drawerWidth,
    flexShrink: 0
  },

  // keeps content and top bar from not touching the side when the drawer goes out
  drawerPaper: {
    width: drawerWidth
  },

  // ????
  drawerHeader: {
    display: "flex",
    alignItems: "nter",
    padding: "0 8px",
    ...theme.mixins.toolbar,
    justifyContent: "flex-end"
  },

  // content positioning
  content: {
    flexGrow: 1,
    //padding: theme.spacing.unit * 3,
    transition: theme.transitions.create("margin", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    }),
    marginLeft: -drawerWidth
  },

  //push text/content to the right
  contentShift: {
    transition: theme.transitions.create("margin", {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen
    }),
    marginLeft: 0
  }
});
/* Drawer class */
class PersistentDrawerLeft extends React.Component {
  state = {
    open: false,
    anchorEl: null
  };

  handleProfileMenuOpen = event => {
    this.setState({ anchorEl: event.currentTarget });
  };

  handleMenuClose = () => {
    this.setState({ anchorEl: null });
  };

  // Open drawer
  handleDrawerOpen = () => {
    this.setState({ open: true });
  };

  // Close drawer
  handleDrawerClose = () => {
    this.setState({ open: false });
  };

  //sublist click
  handleClick = () => {
    this.setState(state => ({ open: !state.open }));
  };

  render() {
    const { classes, theme } = this.props;
    const { open } = this.state;
    const { anchorEl } = this.state;
    const isMenuOpen = Boolean(anchorEl);

    const renderMenu = (
      <Menu
        anchorEl={anchorEl}
        anchorOrigin={{ vertical: "top", horizontal: "left" }}
        transformOrigin={{ vertical: "top", horizontal: "right" }}
        open={isMenuOpen}
        onClose={this.handleMenuClose}
      >
        <MenuItem onClick={this.handleMenuClose}> Practice Settings</MenuItem>
        <MenuItem onClick={this.handleMenuClose}>Help</MenuItem>
        <MenuItem onClick={this.handleMenuClose}>Sign Out</MenuItem>
      </Menu>
    );

    return (
      <div className={classes.root}>
        <CssBaseline />
        <AppBar
          /* do not want relative, static, or sticky; fixed or absolute seems to work */
          position="fixed"
          /* makes sure the apps shifts when the drawer is open */
          className={classNames(classes.appBar, {
            [classes.appBarShift]: open
          })}
        >
          {/* makes sure gutters are disabled when the drawer is not open */}
          <Toolbar disableGutters={!open}>
            {/* Icon button with click action*/}
            <IconButton
              color="inherit"
              aria-label="Open drawer"
              onClick={this.handleDrawerOpen}
              className={classNames(classes.menuButton, open && classes.hide)}
            >
              {/* Menu icon*/}
              <MenuIcon />
            </IconButton>
            {/* MTSaaS Name */}
            <Typography variant="h6" color="inherit" noWrap>
              MTSaaS
            </Typography>
            <div className={classes.rightToolbar}>
              <IconButton color="inherit">
                <Badge color="inherit">
                  <MonetizationOn />
                </Badge>
              </IconButton>
              <IconButton color="inherit">
                <Badge badgeContent={2} color="secondary">
                  <MailIcon />
                </Badge>
              </IconButton>
              <IconButton
                aria-owns={isMenuOpen ? "material-appbar" : undefined}
                aria-haspopup="true"
                onClick={this.handleProfileMenuOpen}
                color="inherit"
              >
                <AccountCircle />
              </IconButton>
            </div>
            {/* no visible change */}
            <div className={classes.sectionMobile}>
              <IconButton
                aria-haspopup="true"
                onClick={this.handleMobileMenuOpen}
                color="inherit"
              />
            </div>
            {/*end of toolbar and Appbar */}
          </Toolbar>
          {renderMenu}
        </AppBar>

        {/* Drawer */}

        <Drawer
          className={classes.drawer}
          variant="persistent"
          anchor="left"
          open={open}
          classes={{
            paper: classes.drawerPaper
          }}
        >
          <div className={classes.drawerHeader}>
            {/*Action to close drawer */}
            <IconButton onClick={this.handleDrawerClose}>
              {theme.direction === "ltr" ? (
                /* Close drawer icon */
                <ChevronLeftIcon />
              ) : (
                <ChevronRightIcon />
              )}
            </IconButton>
          </div>
          <Divider />
          <div>
            <Nestedv2 />
          </div>
        </Drawer>
        <main
          className={classNames(classes.content, {
            [classes.contentShift]: open
          })}
        >
          {/* creates header space in between the body text and the top nav*/}

          <div className={classes.drawerHeader} />
          {/* Title Bar */}
          {/*
          <div>
            <PageTitleBar />
          </div>
*/}
          {/* KPI */}
          {/*
          <div>
            <KPI2 />
            <KPI1 />
          </div>
          */}

          {/* Team members table */}

          {/*
          <div>
            <TeamMemberActions />
            <TeamMembersTable />
          </div>
          */}

          {/* OLD version of Team member details */}
          {/*
          <div>
            <MemberTopPanel />
            <TeamMemberDetailsTabs />
          </div>
          /*}

          {/* NEW Team member details */}

          <div>
            <MemberPanelTabs />
          </div>

          {/* Clients table */}

          {/* Old Client details */}
          {/* 
          <div>
            <ClientTopPanel />
            <ClientDetailsTabs />
          </div>
          */}
          {/* New Client details */}

          <div>
            <ClientPanelTabs />
          </div>

          {/* Acounts and Invoices tabs */}
          {/*
          <div>
            <AccountsInvoicesTabs />
          </div>
          */}
          {/*
          <div>
            <ReactCalendarBase />
          </div>
          */}
          {/* Documentation tabs */}
          {/*
          <div>
            <DocumentationTabs />
          </div>
          */}
          {/* Forms tabs */}
          {/*
          <div>
            <FormsTabs />
          </div>
        */}
        </main>
      </div>
    );
  }
}
/* No visible changes */
PersistentDrawerLeft.propTypes = {
  classes: PropTypes.object.isRequired
  //theme: PropTypes.object.isRequired
};

export default withStyles(styles, { withTheme: true })(PersistentDrawerLeft);
